Verenigde Staten / Duitsland
Thriller / Fantasy
102 minuten

goed

met Adrien Brody, Keira Knightley en Jennifer Jason Leigh

Een veteraan lijdt aan geheugenverlies en keert terug naar zijn geboorteplaats in Vermont. Als hij gearresteerd wordt voor moord 
en in een gesticht wordt geplaatst, zet een arts hem op een zware kuur van experimentele drugs. Zodra hij het goedje ingespoten 
krijgt wordt hij in een dwangbuis gestopt en opgesloten in een bewaarlade in een mortuarium. De drugs hebben echter een vreemd 
neveneffect: de man kan in zijn eigen toekomst kijken.
